import React from 'react';

import Header from '../components/Header';
import Footer from '../components/Footer';

function ExplorarComidas() {
  return (
    <section>
      <Header title="Explorar Comidas" show={ false } />
      <footer>
        <Footer />
      </footer>
    </section>);
}

export default ExplorarComidas;
